import React from "react";
import carMarket from "./carMarket";
import "./App.css";
import Nav from "./components/nav/Nav.js";

function App() {
  // console.log(carMarket);
  const getAllButtonsLable = (data) => {
    let res = [];
    for (let key in carMarket) {
      res.push(key);
    }
    return res.map((title) => {
      console.log(title);
      let btntitle = title.charAt(0).toUpperCase() + title.slice(1);
      return btntitle.replace("_", " ");
      // console.log(btntitle);
      // return btntitle;
    });
  };
  console.log(getAllButtonsLable(carMarket));
  return (
    <div className="nav">
      <Nav />
    </div>
  );
}

export default App;
